        <h2 style={{ fontSize: "55px", fontWeight: "600" }}>{text1}</h2>
      </div>
      <Link to={link1} className={styles.link}>
        <div style={{ fontSize: "35px", color: "#000000" }}>{text2}</div>
      </Link>
    </div>
  );
}

export default AccountNav;
